INSERT INTO `v1_7b6ea8ba8af514d1443a50a7fdc9cba861953074ec8f61a48a070b737d207390` VALUES (76020004, 602000406, "ＴＰダウンカット", "バトル開始時、すべてのモンスターがＴＰダウン\n50％カット状態になる。", "boss_tp_down_cut");
INSERT INTO `v1_7b6ea8ba8af514d1443a50a7fdc9cba861953074ec8f61a48a070b737d207390` VALUES (76020005, 602000501, "ダメージ減衰", "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 18);
INSERT INTO `v1_7b6ea8ba8af514d1443a50a7fdc9cba861953074ec8f61a48a070b737d207390` VALUES (76020005, 602000502, "ＴＰ上昇上限付与", "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 17);
INSERT INTO `v1_7b6ea8ba8af514d1443a50a7fdc9cba861953074ec8f61a48a070b737d207390` VALUES (76020005, 602000503, "物理防御力（ダウン不可）アップ", "バトル開始時、すべてのモンスターの物理防御力を中アップさせる。この効果は物理防御力ダウンの影響を受けない。", "boss_def_lower_limit");
INSERT INTO `v1_7b6ea8ba8af514d1443a50a7fdc9cba861953074ec8f61a48a070b737d207390` VALUES (76020005, 602000504, "魔法防御力（ダウン不可）アップ", "バトル開始時、すべてのモンスターの魔法防御力を中アップさせる。この効果は魔法防御力ダウンの影響を受けない。", "boss_magic_def_lower_limit");
INSERT INTO `v1_7b6ea8ba8af514d1443a50a7fdc9cba861953074ec8f61a48a070b737d207390` VALUES (76020005, 602000505, "ＨＰ吸収ダウン", "バトル開始時、すべてのキャラのＨＰ吸収を特大ダウンさせる。", 9);
